Map {
User Stories {
Display Unsupported Orders: As a user, I want to be able to view all orders that are not supported by the literature application.
Select Travel Time: As a user, I want to be able to select a travel time for my order.
View Order Status: As a user, I want to be able to view the status of my order.
Edit Order Details: As a user, I want to be able to edit the details of my order.
Cancel Order: As a user, I want to be able to cancel my order.
}
Admin Stories {
Manage Orders: As an admin, I want to be able to manage orders in the literature application.
View Order History: As an admin, I want to be able to view the order history of all users.
Manage Users: As an admin, I want to be able to manage users in the literature application.
}
}
